var _ = require('underscorek');

module.exports = {
	test: function(expectVer) {
		var check = (_.version == expectVer ? true : false);
		log('invoked test from library-zzz with underscorek version: ' +
			_.version + (check ? '' : ' (expected: ' + expectVer + ')'),
			(check ? 'green' : 'red'),
			__filename);
	}
}

log('module library-zzz loaded', 'reset', __filename);